A sheet of 8-inch by 10-inch paper is placed on top of a sheet of $8 \frac{1}{2}$-inch by 11-inch paper, as shown. What is the area of the region of overlap in square inches?

[asy]draw((0,0)--(10,0)--(10,8)--(0,8)--(0,0)--cycle,linewidth(2));
draw((0,8)--(8.5,8)--(8.5,11.5)--(0,11.5)--(0,8)--cycle,linewidth(2));

draw((8.5,0)--(8.5,8),dashed);
[/asy]

solution:
We label the lengths on the diagram:
[asy]
pair A = (0,0), B = (10,0), C = (10,8), D = (0,8), F = (0,8), G = (8.5,8), H = (8.5,11), I = (0,11), J = (8.5,0);

draw(A--B--C--D--cycle,linewidth(2));
draw(F--G--H--I--cycle,linewidth(2));
draw(G--J,dashed);
label("8.5",(A+J)/2,S);
label("1.5",(J+B)/2,S);
label("8",(A+F)/2,W);
label("3",(F+I)/2,W);
[/asy]
So the area of the overlapping region is $8.5\cdot8=\boxed{68}$ square inches.

problem:
Given that

\begin{align*}
\frac{1}{x}+\frac{1}{y}&=5,\\
3xy+x+y&=4,
\end{align*}

compute $x^2y+xy^2$.

solution:
Remember that $\frac{1}{3} = 0.\overline{3}.$ We can multiply both the numerator and denominator by $10$ to help simplify the fraction: \begin{align*}
\frac{0.\overline{3}}{0.8\overline{3}} \cdot \frac{10}{10} &= \frac{0.\overline{3}\cdot 10}{0.8\overline{3} \cdot 10} =\frac{3.\overline{3}}{8.\overline{3}} \\
&=\dfrac{3+\frac{1}{3}}{8+\frac{1}{3}} =\dfrac{\frac{10}{3}}{\frac{25}{3}} \\
&=\frac{\cancelto{2}{10}}{\cancel{3}} \cdot \frac{\cancel{3}}{\cancelto{5}{25}\hspace{3mm}} =\boxed{\frac{2}{5}}.
\end{align*}

Writing everything in terms of prime factorizations, the given expression is  \begin{align*}
&\sqrt{3 \cdot 5 \cdot 2^2 \cdot 3 \cdot 2^2 \cdot 7 \cdot 3^2 \cdot x^3} \\
& \qquad = \sqrt{(3^4 \cdot 2^4 \cdot x^2) \cdot (5 \cdot 7 \cdot x)} \\
& \qquad = \boxed{36x \sqrt{35x}}.
\end{align*}

By the angle bisector theorem, $AC/CD = AB/BD = 12/4 = 3$.  Let $AC = 3x$ and $CD = x$.

[asy]
unitsize(0.3 cm);

pair A, B, C, D;

A = (0,12);
B = (0,0);
C = (9,0);
D = (4,0);

draw(A--B--C--cycle);
draw(A--D);

label("$A$", A, NW);
label("$B$", B, SW);
label("$C$", C, SE);
label("$D$", D, S);
label("$4$", (B + D)/2, S);
label("$12$", (A + B)/2, W);
label("$x$", (C + D)/2, S);
label("$3x$", (A + C)/2, NE);
[/asy]

Then by Pythagoras, $(x + 4)^2 + 12^2 = (3x)^2$.  This simplifies to $8x^2 - 8x - 160 = 0$, which factors as $8(x - 5)(x + 4) = 0$, so $x = 5$.  Therefore, $AC = 3x = \boxed{15}$.

