This curve can also be expressed in the form
\[ax^4 - bx^2 + cy^2 = 0,\]where $a,$ $b,$ and $c$ are positive integers.  Find the smallest possible value of $a + b + c.$

solution:
We first draw out the figure described in this problem and label the important points with circle $A$ having radius $10$ ft and circle $B$ having radius $17$ feet: [asy]
size(150);
defaultpen(linewidth(.7pt));

draw(Circle((10,17),10));
draw(Circle((31,17),17));
draw((16,25)--(16,9));
draw((10,17)--(31,17)--(16,9)--cycle);
draw((14.5,17)--(14.5,15.5)--(17.5,15.5)--(17.5,17),linewidth(.7));
dot((10,17),linewidth(3));
dot((16,25),linewidth(3));
dot((31,17),linewidth(3));
dot((16,9),linewidth(3));
dot((16,17),linewidth(3));
label("A",(10,17),NW);
label("D",(16,25),N);
label("B",(31,17),NE);
label("C",(16,9),S);
label("E",(16,17),NE);
[/asy] Since $\overline{AC}$ is a radius of circle $A$ and $\overline{BC}$ is a radius of circle $B$, we have that $AC=10$ and $BC=17$. Also, since $\overline{DC}$ is a common chord to the two circles, line segment $\overline{AB}$, which connects the centers of the two circles, must both bisect $\overline{DC}$ and be perpendicular to it. We'll call the point of intersection of these two lines point $E$ and since $DC=16$, $\overline{EC}$ must have length $8$.

Now we notice that we have two right triangles $\triangle AEC$ and $\triangle BEC$. Since we know the lengths of $\overline{AC}$ and $\overline{EC}$, we can find the length of $\overline{AE}$ using the Pythagorean Theorem:  \begin{align*}
& AE^2 + EC^2 = AC^2 \\
\Rightarrow \qquad & AE = \sqrt{10^2-8^2}=6
\end{align*}  Similarly, we can use the Pythagorean Theorem to find that the length of $\overline{EB}$ is $\sqrt{17^2-8^2}=15$. The length of $\overline{AB}$, the distance between the two centers of the circles, must be the sum of the lengths of $\overline{AE}$ and $\overline{EB}$, which is $6+15=\boxed{21}$ feet.

In isosceles right triangle $\triangle ABC$ below, $\overline{AD}$ is the altitude to the hypotenuse.

[asy]
import olympiad;
unitsize(0.8inch);
pair A,B,C,D;
A = (0,1);
B= (1,0);
C = -B;
D = (0,0);
draw(A--B--C--A,linewidth(1));
draw(A--D,linewidth(0.8));
draw(rightanglemark(C,A,B,s=4));
draw(rightanglemark(C,D,A,s=4));
label("$A$",A,N);
label("$B$",B,S);
label("$C$",C,S);
label("$D$",D,S);
[/asy]

Because $\triangle ABC$ is an isosceles right triangle, $\angle ABC = 45^\circ$.  Since $\angle ADB = 90^\circ$, we know that $\angle DAB = 45^\circ$, so $\triangle ABD$ is also a 45-45-90 triangle.  Similarly, $\triangle ACD$ is a 45-45-90 triangle.  Therefore, $DA=DB = DC = 5$, so $BC = BD+DC = 10$, and  \[[ABC] = \frac{(AD)(BC)}{2} = \frac{(5)({10})}{2} = \boxed{25}.\]

$S$ looks like a nonagon with slightly rounded corners.  We draw adjacent sides of the nonagon and look at the boundary of $S$:

[asy]
size(200);
draw((-7.66,-6.43)--(0,0)--(10,0)--(17.66,-6.43));
draw((0,5)--(10,5),blue); draw((13.21,3.83)--(20.87,-2.60),blue);
draw(Arc((10,0),5,50,90),red); draw(Arc((0,0),5,90,130),red);
draw((10,0)--(10,5),dashed); draw((0,0)--(0,5),dashed);
draw((10,0)--(13.21,3.83),dashed);
label("2",(5,0),S); label("1",(10,2.5),W);
draw((-3.21,3.83)--(-10.87,-2.60),blue);
draw((-3.21,3.83)--(0,0),dashed);
[/asy] We can split the portion of $S$ that is outside the nonagon into 9 rectangles and 9 circle sectors, thereby breaking the perimeter of $S$ into alternating straight lines (colored blue above) and curved arcs (colored red above).  The perimeter of $S$ is comprised of nine blue lines and nine red arcs.

Each rectangle has side lengths 1 and 2, so each blue line is 2 units long and the total length of the blue portion of the perimeter is $2\cdot 9 = 18$ units.

Around each vertex of the nonagon, an interior angle, two right angles, and an angle of the circular sector add up to 360 degrees.  The angles inside a nonagon each measure $180(9-2)/9=140$ degrees.  Thus, each circular sector angle measures $360-90-90-140=40$ degrees.  Each sector has radius 1 and arc length $\frac{40^\circ}{360^\circ}(2)(\pi)(1)=\frac{1}{9}(2\pi)$, so nine of these sectors have total arc length $2\pi$.  Thus the total length of the red portion of the perimeter is $2\pi$ units.  (Notice that this is equal to the perimeter of a circle with radius 1, which is what the nine sectors add up to.)

Finally, the perimeter of $S$ is $\boxed{18+2\pi}$ units.

