There are 12 hours on a clock, so each hour mark is $360^\circ/12 = 30^\circ$ from its neighbors.  At 2:48 the minute hand points at minute 48, which is $\frac35$ of the way from hour 9 to hour 10.  Therefore, the minute hand is $\frac35\cdot 30 = 18^\circ$ past hour 9, which means it is $30^\circ - 18^\circ = 12^\circ$ shy of hour 10.  This means the minute hand is $2\cdot 30^\circ + 12^\circ = 72^\circ$ shy of hour 12.

The hour hand is $\frac{48}{60} = \frac45$ of the way from hour 2 to hour 3, so it is $\frac45\cdot 30^\circ = 24^\circ$ past hour 2.  So, the hour hand is $2\cdot 30^\circ + 24^\circ = 84^\circ$ past hour 12.

Combining the angles between each hand and hour 12, the angle between the hands is $72^\circ + 84^\circ = \boxed{156^\circ}$.

problem:
Each triangle is a 30-60-90 triangle, and the hypotenuse of one triangle is the longer leg of an adjacent triangle. The hypotenuse of the larger triangle is 16 centimeters. What is the number of centimeters in the length of the longer leg of the smaller triangle?

[asy]size(150); pair O; for(int i = 2; i < 5; ++i){
draw(O--((2/sqrt(3))^i)*dir(30*i));
}
for(int g = 2; g < 4; ++g){
draw( ((2/sqrt(3))^g)*dir(30*g)-- ((2/sqrt(3))^(g+1))*dir(30*g+30));
}
label("16 cm", O--(16/9)*dir(120), W);
//label("$30^{\circ}$",.4*dir(0),dir(90));
//label("$30^{\circ}$",.4*dir(25),dir(115));
label("$30^{\circ}$",.4*dir(50),dir(140));
label("$30^{\circ}$",.4*dir(85),dir(175));
real t = (2/(sqrt(3)));
//draw(rightanglemark((1,.1),(1,0),(.9,0),s=3));
draw(rightanglemark(rotate(30)*(0,t**4),rotate(0)*(0,t**3),O,s=3));
draw(rightanglemark(rotate(0)*(0,t**3),rotate(-30)*(0,t**2),O,s=3));
//draw(rightanglemark(rotate(-30)*(0,t**2),rotate(-60)*(0,t**1),O,s=3));
[/asy]

solution:
First, we label the diagram as shown below:

[asy] size(170);
pair O; for(int i = 2; i < 5; ++i){
draw(O--((2/sqrt(3))^i)*dir(30*i));
}
for(int g = 2; g < 4; ++g){
draw( ((2/sqrt(3))^g)*dir(30*g)-- ((2/sqrt(3))^(g+1))*dir(30*g+30));
}
label("16 cm", O--(16/9)*dir(120), W);
//label("$30^{\circ}$",.4*dir(0),dir(90));
//label("$30^{\circ}$",.4*dir(25),dir(115));
label("$30^{\circ}$",.4*dir(50),dir(140));
label("$30^{\circ}$",.4*dir(85),dir(175));
real t = (2/(sqrt(3)));
label("$B$",(0,t**3),N);
label("$A$",rotate(30)*(0,t**4),NW);
label("$C$",rotate(-30)*(0,t*t),NE);
//label("$D$",rotate(-60)*(0,t),NE);
//label("$E$",(1,0),E);
label("$O$",O,S);
//draw(rightanglemark((1,.1),(1,0),(.9,0),s=3));
draw(rightanglemark(rotate(30)*(0,t**4),rotate(0)*(0,t**3),O,s=3));
draw(rightanglemark(rotate(0)*(0,t**3),rotate(-30)*(0,t**2),O,s=3));
//draw(rightanglemark(rotate(-30)*(0,t**2),rotate(-60)*(0,t**1),O,s=3));
[/asy]

Both right triangles are 30-60-90 triangles. Therefore, the length of the shorter leg in each triangle is half the hypotenuse, and the length of the longer leg is $\sqrt{3}$ times the length of the shorter leg.  We apply these facts to each triangle, starting with $\triangle AOB$ and working clockwise.

From $\triangle AOB$, we find $AB = AO/2 = 8$ and $BO = AB\sqrt{3}=8\sqrt{3}$.

From $\triangle BOC$, we find $BC = BO/2 =4\sqrt{3}$ and $CO = BC\sqrt{3} =4\sqrt{3}\cdot\sqrt{3} = \boxed{12}$.

Rotating the triangle about one of its legs produces a cone with radius 2 and height 2:  [asy]
size(90);
import solids; currentprojection = orthographic(5,0,1);
revolution c = cone((0,0,0), 2,2);
draw(c,heavycyan);
draw((0,0,0)--(0,2,0)--(0,0,2)--cycle);
label("2",(0,1,0),S); label("2",(0,0,1),W);
[/asy]

The base of the cone is a circle with radius 2, which has area $2^2\pi=4\pi$.

When unrolled, the curved lateral area of the cone becomes a flat sector of a circle: [asy]
size(110);
draw(Arc((0,0),1,0,254.56),heavycyan);
draw(Arc((0,0),1,254.56,360),heavycyan+linetype("2 4"));
draw((cos(4.44),sin(4.44))--(0,0)--(1,0),heavycyan);
[/asy] The sector's radius is the cone's slant height, which, by the Pythagorean theorem, is \[\sqrt{2^2+2^2}=2\sqrt{2}.\]The sector's arc length is the cone's base perimeter, which is \[2(\pi)(2)=4\pi.\]The circle's circumference is \[2(\pi)(2\sqrt{2}) = 4\sqrt{2}\pi,\]so the ratio of the sector's area to the circle's area is $\frac{4\pi}{4\sqrt{2}\pi}=\frac{1}{\sqrt{2}}$.  The circle's area is \[(2\sqrt{2})^2\pi=8\pi,\]so the sector's area is \[\frac{1}{\sqrt{2}}\cdot 8\pi = 4\sqrt{2}\pi.\]Summing the lateral area and the base area gives a total surface area of ${4\sqrt{2}\pi+4\pi}$, so its total surface area is $\boxed{4\sqrt{2} + 4}$ times $\pi$.

Let $O$ be the center of the sphere, and assume for now that $O$ is inside polyhedron $P$. We can carve polyhedron $P$ into pyramids, each of which has a face of $P$ as its base and $O$ as its apex. For example, a cube would be carved into six pyramids, two of which are highlighted in this drawing: [asy]
size(4cm);
import three;
triple A,B,C,D,EE,F,G,H;
A = (0,0,0);
B = (1,0,0);
C = (1,1,0);
D= (0,1,0);
EE = (0,0,1);
F = B+EE;
G = C + EE;
H = D + EE;
O = G/2;
draw(surface(B--O--C--cycle),red,nolight);
draw(surface(C--O--D--cycle),red+white,nolight);
draw(surface(H--O--G--cycle),lightblue,nolight);
draw(surface(G--O--F--cycle),blue,nolight);
draw(surface(EE--F--G--H--cycle),lightblue+blue,nolight);
draw(B--C--D);
draw(B--A--D,dashed);
draw(EE--F--G--H--EE);
draw(A--EE,dashed);
draw(B--F);
draw(C--G);
draw(D--H);
draw(A--O--C,dashed);
draw(B--O--D,dashed);
draw(EE--O--G,dashed);
draw(F--O--H,dashed);
dot(A); dot(B); dot(C); dot(D); dot(EE); dot(F); dot(G); dot(H); dot(O);
label("$O$",O,WSW);
[/asy] Then if we add up the areas of all the pyramids' bases, we get the surface area of $P$. If we add up the volumes of the pyramids, we get the volume of $P$.

The volume of each pyramid is equal to $\frac 13\cdot\text{(area of base)}\cdot\text{(height)}$. The height of each pyramid must be less than $36$, since the height of each pyramid extends from $O$ to a point inside the sphere. Therefore, the volume of each pyramid is less than $12$ times the area of the base. It follows that the volume of $P$ is less than $12$ times the surface area of $P$. We can, however, make this ratio arbitrarily close to $12$ by selecting polyhedra $P$ with many small faces, so that the height of each pyramid is as close as we wish to $36$.

Therefore, for polyhedra inscribed in a sphere of radius $36$ such that the center of the sphere lies inside the polyhedron, the least upper bound on $$\frac{\text{volume of }P}{\text{surface area of }P}$$is $12$. Finally, we must consider the case of inscribed polyhedra for which the center of the sphere does not lie inside the polyhedron. However, in this case, we can still construct pyramids with apex $O$ whose bases are the faces of $P$; then the surface area of $P$ is still the sum of the areas of the bases, but the volume of $P$ is less than the total volume of the pyramids. This only strengthens the argument for an upper bound of $12$. So, the answer is $\boxed{12}$.

We begin with a drawing of the graph and the polygon in question (it's possible to solve the problem without drawing this picture, but we provide it for clarity): [asy]
pair v1=(-1,0); pair v2=(0,-5/3); pair v3=(5,0);
fill(v1--v2--v3--cycle,pink);
draw(v1--v2--v3--cycle,black+0.5+dashed);
dot(v1); dot(v2); dot(v3);

import graph; size(7cm); real lsf=0.5; pen dps=linewidth(0.7)+fontsize(10); defaultpen(dps); pen ds=black; real xmin=-2.3,xmax=6.3,ymin=-3.3,ymax=2.3;

pen cqcqcq=rgb(0.75,0.75,0.75);

/*grid*/ pen gs=linewidth(0.7)+cqcqcq+linetype("2 2"); real gx=1,gy=1;
for(real i=ceil(xmin/gx)*gx;i<=floor(xmax/gx)*gx;i+=gx) draw((i,ymin)--(i,ymax),gs); for(real i=ceil(ymin/gy)*gy;i<=floor(ymax/gy)*gy;i+=gy) draw((xmin,i)--(xmax,i),gs);

Label laxis; laxis.p=fontsize(10);

xaxis("",xmin,xmax,Ticks(laxis,Step=1.0,Size=2,NoZero),Arrows(6),above=true); yaxis("",ymin,ymax,Ticks(laxis,Step=1.0,Size=2,NoZero),Arrows(6),above=true);
real f1(real x){return ((x-2)^2-9)/3;} draw(graph(f1,-2,6),linewidth(0.75));
clip((xmin,ymin)--(xmin,ymax)--(xmax,ymax)--(xmax,ymin)--cycle);

[/asy] The $y$-intercept of the graph is $(0,f(0)) = \left(0,-\frac53\right)$. To find the $x$-intercepts, we solve the equation $$\frac{(x-2)^2-9}{3} = 0,$$which yields $$(x-2)^2 = 9$$and thus $x=2\pm 3$. So, the $x$-intercepts are $(-1,0)$ and $(5,0)$.

The triangle whose vertices are $(-1,0),$ $(5,0),$ and $\left(0,-\frac 53\right)$ has base $6$ and height $\frac 53$, so its area is $$\frac 12\cdot 6\cdot \frac 53 = \boxed{5}.$$

problem:
Let $z = 2 + \sqrt{2} - (3 + 3 \sqrt{2})i$, and let $c = 2 - 3i$.  Let $w$ be the result when $z$ is rotated around $c$ by $\frac{\pi}{4}$ counter-clockwise.

[asy]
unitsize(0.6 cm);

pair C, W, Z;

Z = (2 + sqrt(2), -3 - 3*sqrt(2));
