problem:
In trapezoid $ABCD$ with bases $\overline{AB}$ and   $\overline{CD}$, we have $AB = 52$, $BC = 12$, $CD = 39$, and $DA = 5$. What is the area of $ABCD$?

[asy]
pair A,B,C,D;
A=(0,0);
B=(4,0);
C=(3.3,1);
D=(0.3,1);
label("$A$",A,S);
label("$B$",B,S);
label("$C$",C,N);
label("$D$",D,N);
label("52",(2,0),S);
label("39",(1.8,1),N);
label("5",(0.15,0.5),W);
label("12",(3.65,0.5),E);
draw(A--B--C--D--cycle);
[/asy]

solution:
First drop perpendiculars from $D$ and $C$ to $\overline{AB}$. Let $E$ and $F$ be the feet of the perpendiculars to $\overline{AB}$ from $D$ and $C$, respectively,  and let $$
h = DE = CF, \quad x = AE, \quad\text{and}\quad y = FB.
$$[asy]
pair A,B,C,D;
A=(0,0);
B=(4,0);
C=(3.3,1);
D=(0.3,1);
draw(D--(0.3,0));
draw(C--(3.3,0));
label("$E$",(0.3,0),SE);
label("$F$",(3.3,0),S);
label("$x$",(0.15,0),S);
label("$y$",(3.65,0),S);
label("$h$",(0.3,0.5),E);
label("$h$",(3.3,0.5),W);
label("$A$",A,SW);
label("$B$",B,S);
label("$C$",C,N);
label("$D$",D,N);
label("39",(2,0),S);
label("39",(1.8,1),N);
label("5",(0.15,0.5),W);
label("12",(3.65,0.5),E);
draw(A--B--C--D--cycle);
[/asy] Then $$
25 = h^2 + x^2, \quad 144 = h^2 + y^2, \quad\text{and}\quad 13 = x+y.
$$So $$
144 = h^2 + y^2 = h^2 + (13-x)^2 = h^2 + x^2 + 169 - 26x = 25 + 169- 26x,
$$which gives    $x = 50/26 = 25/13$, and $$
h= \sqrt{5^2 - \left(\frac{25}{13}\right)^2} = 5\sqrt{1 - \frac{25}{169}}
= 5\sqrt{\frac{144}{169}} = \frac{60}{13}.
$$Hence $$
\text{Area }(ABCD) = \frac{1}{2}(39 + 52)\cdot\frac{60}{13} = \boxed{210}.
$$$$
\text{OR}
$$Extend  $\overline{AD}$  and  $\overline{BC}$  to intersect at $P$. Since $\triangle PDC$ and $\triangle PAB$ are similar, we have $$
\frac{PD}{PD + 5} = \frac{39}{52} =
\frac{PC}{PC+12}.
$$So $PD = 15$ and $PC = 36$. Note that $15$, $36$, and $39$ are three times $5$, $12$, and $13$, respectively, so $\angle APB$ is a right angle. The area of the trapezoid is the difference of the areas of $\triangle PAB$ and $\triangle PDC$, so $$
\text{Area}(ABCD) =\frac{1}{2}(20)(48) - \frac{1}{2}(15)(36) = \boxed{210}.
$$[asy]
pair A,B,C,D;
A=(0,0);
B=(4,0);
C=(3.3,1);
D=(0.3,1);
label("$A$",A,S);
label("$B$",B,S);
label("$C$",C,E);
label("$D$",D,W);
draw((1.2,4)--C--D--cycle);
label("$P$",(1.2,4),N);
draw(A--B--C--D--cycle);
[/asy] $$
\text{OR}
$$Draw the line through $D$ parallel to  $\overline{BC}$, intersecting  $\overline{AB}$ at $E$. Then $BCDE$ is a parallelogram, so $DE = 12$, $EB = 39$, and $AE = 52 - 39 = 13.$ Thus $DE^2 + AD^2 = AE^2$, and  $\triangle ADE$ is a right triangle. Let $h$ be the altitude from $D$ to  $\overline{AE}$, and note that $$
\text{Area}(ADE) = \frac{1}{2}(5)(12) = \frac{1}{2}(13)(h),
$$so $h = 60/13$. Thus $$
\text{Area}(ABCD) =\frac{60}{13}\cdot\frac{1}{2}(39 + 52) = \boxed{210}.
$$[asy]
pair A,B,C,D;
A=(0,0);
B=(4,0);
C=(3.3,1);
D=(0.3,1);
label("$A$",A,S);
label("$B$",B,S);
label("$C$",C,N);
label("$D$",D,N);
draw(D--(1,0));
label("$E$",(1,0),S);
draw(A--B--C--D--cycle);
[/asy]

problem:
A rectangular field is enclosed in an athletic track, as shown below.  The track consists of two edges of the field, and two semicircles.  The length of the track is 400 meters.  What is the largest possible area of the field, in square meters?

[asy]
unitsize(1 cm);

filldraw((0,0)--(3,0)--(3,2)--(0,2)--cycle,lightgreen);
draw((0,0)--(3,0),linewidth(2*bp));
draw((0,2)--(3,2),linewidth(2*bp));
draw(arc((3,1),1,-90,90),linewidth(2*bp));
draw(arc((0,1),1,90,270),linewidth(2*bp));
[/asy]

solution:
Let the width of the rectangle be $w,$ and let the radius of each semicircle be $r.$

[asy]
unitsize(1 cm);

filldraw((0,0)--(3,0)--(3,2)--(0,2)--cycle,lightgreen);
draw((0,0)--(3,0),linewidth(2*bp));
draw((0,2)--(3,2),linewidth(2*bp));
draw(arc((3,1),1,-90,90),linewidth(2*bp));
draw(arc((0,1),1,90,270),linewidth(2*bp));

label("$w$", (1.5,0), S);
label("$r$", (3,1/2), E);
dot((3,1));
[/asy]

Then the length of the track is $2w + 2 \pi r = 400,$ so $w + \pi r = 200.$  By AM-GM,
\[200 = w + \pi r \ge 2 \sqrt{w \pi r},\]so $\sqrt{w \pi r} \le 100.$  Then $w \pi r \le 10000,$ so
\[wr \le \frac{10000}{\pi}.\]Then the area of the field, $2wr,$ must satisfy
\[2wr \le \frac{20000}{\pi}.\]Equality occurs when $w = 100$ and $r = \frac{100}{\pi},$ so the largest possible area is $\boxed{\frac{20000}{\pi}}.$

Call the number of red marbles $a$, the number of yellow marbles $b$, the number of orange marbles $c$, and the number of white marbles $d$. We can express the information given in the problem by the following system of linear equations:  \begin{align*}
a+b+c+d &= 35\\
\frac{a}{2} = b - 2 = \frac{c}{3} &= \frac{d+3}{3}
\end{align*} Using the second expression, we can solve for $a$, $c$, and $d$ in terms of $b$:
\begin{align*}
a &= 2b - 4,\\
c &= 3b - 6, \\
d &= 3b - 9
\end{align*} Putting these values into the first equation gives $2b - 4 + b + 3b - 6 + 3b - 9 = 35$, so $b = 6$. Because $a = 2b - 4$, $a = 12 - 4 = \boxed{8}$.

