label("B", B, SW);
label("C", C, SE);
label("R", R, dir(270));
label("Q", Q, SW);
label("S", S, SE);
label("P", P, N);
dot(Q);
dot(P);
dot(S);
dot(R);
[/asy]

Drop perpendiculars from $Q$, $R$ and $S$ to $D$, $E$ and $F$ respectively on $BC$.


[asy]
size(250);
pair P, Q, R, S, B, C, D, E, F, Y;
P=(4,2.236);
Q=(2.414,1);
R=(4,.618);
S=(5.586,1);
B=(0,0);
C=(8,0);
D=(2.414,0);
E=(4,0);
F=(5.586,0);
Y=(4,1);
draw(circle(P,1));
draw(circle(Q,1));
draw(circle(S,1));
draw(circle(R,.618));
draw(B--C);
draw(Q--D);
draw(P--E);
draw(F--S);
draw(Q--S);
draw(Q--P--S--R--Q);
label("D", D, dir(270));
label("E", E, dir(270));
label("F", F, dir(270));
label("P", P, N);
label("Q", Q, NW);
label("S", S, NE);
label("R", R, SW);
label("Y", Y, NW);
dot(P);
dot(Q);
dot(R);
dot(S);
[/asy]

Since the circles with centers $Q$, $R$ and $S$ are tangent to $BC$, then $D$, $E$ and $F$ are the points of tangency of these circles to $BC$. Thus, $QD=SF=1$ and $RE=r$.

Join $QR$, $RS$, $PS$, $PQ$, and $PR$. Since we are connecting centers of tangent circles, $PQ=PS=2$ and $QR=RS=PR=1+r$.

Join $QS$. By symmetry, $PRE$ is a straight line (that is, $PE$ passes through $R$). Since $QS$ is parallel to $BC$, $QS$ is perpendicular to $PR$, meeting at $Y$.

Since $QD=1$, $YE=1$.  Since $RE=r$, $YR=1-r$. Since $QR=1+r$, $YR=1-r$ and $\triangle QYR$ is right-angled at $Y$, then by the Pythagorean Theorem,
\begin{align*}
QY^2 &= QR^2 - YR^2\\
&= (1+r)^2 - (1-r)^2 \\
&= (1+2r+r^2)-(1-2r+r^2) \\
&= 4r.
\end{align*}Since $PR=1+r$ and $YR=1-r$, then $PY = PR-YR=2r$. Since $\triangle PYQ$ is right-angled at $Y$,
\begin{align*}
PY^2 + YQ^2 & = PQ^2 \\
(2r)^2 + 4r & = 2^2 \\
4r^2 + 4r & =4 \\
r^2 + r - 1 & = 0.
\end{align*}By the quadratic formula, $r = \dfrac{-1\pm \sqrt{1^2-4(1)(-1)}}{2} = \dfrac{-1\pm\sqrt{5}}{2}$.
Since $r>0$, then $r = \dfrac{-1+\sqrt{5}}{2}$ (which is the reciprocal of the famous ``golden ratio"). Thus, $a+b+c=-1+5+2=\boxed{6}$.

problem:
Assume that the length of Earth's equator is exactly 25,100 miles and that the Earth is a perfect sphere. The town of Lena, Wisconsin, is at $45^{\circ}$ North Latitude, exactly halfway between the equator and the North Pole. What is the number of miles in the circumference of the circle on Earth parallel to the equator and through Lena, Wisconsin? Express your answer to the nearest hundred miles.  (You may use a calculator for this problem.)

[asy]
size(4.5cm,4.5cm);
draw(unitcircle);
draw((-1,0)..(0,-0.2)..(1,0));
draw((-0.95,0.05)..(0,0.2)..(0.97,0.05),1pt+dotted);
draw((-0.7,0.7)..(0,0.6)..(0.7,0.7));
draw((-0.65,0.75)..(0,0.8)..(0.66,0.75),1pt+dotted);
dot((0,0));
draw((0,0)--(1,0));
draw((0,0)--(0.7,0.7));
dot((0.7,0.7));
dot((0,0.72));
label("Lena",(0.7,0.7),ENE);
label("$45^\circ$",shift(0.3,0.1)*(0,0));
[/asy]

solution:
Let Earth's radius be $r$.  Since the equator measures 25100 miles, we have $2\pi r = 25100 \Rightarrow r = \frac{12550}{\pi}$.

[asy]
defaultpen(linewidth(.7pt)+fontsize(10pt));
size(4.5cm,4.5cm);
draw(unitcircle);
draw((-1,0)..(0,-0.2)..(1,0));
draw((-0.95,0.05)..(0,0.2)..(0.97,0.05),1pt+dotted);
draw((-0.7,0.7)..(0,0.6)..(0.7,0.7));
draw((-0.65,0.75)..(0,0.8)..(0.66,0.75),1pt+dotted);
dot((0,0));
draw((0,0)--(1,0));
draw((0,0)--(0.7,0.7));
dot((0.7,0.7));
dot((0,0.72));
