Given regular pentagon $ABCDE,$ a circle can be drawn that is tangent to $\overline{DC}$ at $D$ and to $\overline{AB}$ at $A.$ In degrees, what is the measure of minor arc $AD$? [asy]import olympiad; import geometry; size(100); defaultpen(linewidth(0.8));
pair[] pentagon = new pair[5];
pentagon[0] = dir(36);
pentagon.cyclic=true;
for(int i = 1; i < 6; ++i){

pentagon[i] = dir(72*i + 36);

draw(pentagon[i - 1]--pentagon[i]);
}
dot("$C$",pentagon[0],NE);
dot("$D$",pentagon[1],N);
dot("$E$",pentagon[2],W);
dot("$A$",pentagon[3],S);
dot("$B$",pentagon[4],SE);
line x = line(pentagon[1],pentagon[1] + dir(-108));
line x2 = line(origin,pentagon[2]);
pair ccenter = coordinates(intersectionpoint(x,x2));
draw(Circle(ccenter,arclength(ccenter--pentagon[1])));
[/asy]

solution:
Let $O$ be the center of the circle.  The sum of the angles in pentagon $ABCDO$ is $3 (180^\circ) = 540^\circ.$ Since $\angle ABC$ and $\angle BCD$ are interior angles of a regular pentagon, they each measure $108^\circ.$ The given circle is tangent to $\overline{AB}$ at $A$ and to $\overline{CD}$ at $D,$ and so it follows that $\angle OAB = \angle ODC = 90^\circ.$ Then \[\begin{aligned} \angle AOD &= 540^\circ - \angle ABC - \angle BCD - \angle OAB - \angle ODC \\ &=  540^\circ - 2 (108^\circ) - 2 (90^\circ) = 144^\circ. \end{aligned}\]Thus, the measure of minor arc $AD$ is also $\boxed{144^\circ}.$
[asy]size(4cm);pair A=dir(-108),B=dir(-36),C=dir(36),D=dir(108),E=dir(180),O=extension(D,dir(-90)*(C-D)+D,A,dir(90)*(B-A)+A);
draw(A--B--C--D--E--cycle ^^ Circle(O, abs(O-D)) ^^ A--O--D);
dot("$A$",A,SE);
dot("$B$",B,SE);
dot("$C$",C,NE);
dot("$D$",D,NE);
dot("$E$",E,W);
dot("$O$",O,dir(0));
[/asy]

Dividing by $400,$ we get the standard form of the equation for the first ellipse: \[\frac{x^2}{16}+\frac{y^2}{25}=1.\]Therefore, the semiaxes have lengths $\sqrt{16}=4$ and $\sqrt{25}=5,$ which means that the distance from the center $O=(0,0)$ to each focus is $\sqrt{5^2-4^2}=3.$ Since the vertical axis is longer than the horizontal axis, it follows that the foci of the first ellipse are at $(0, \pm 3).$

[asy]
unitsize(0.5 cm);

pair O = (0,0), F = (0,3);
path ellone = yscale(5)*xscale(4)*Circle((0,0),1);
path elltwo = shift((0,3/2))*yscale(7/2)*xscale(sqrt(10))*Circle((0,0),1);

draw((-5,0)--(5,0));
draw((0,-6)--(0,6));
draw(ellone);
draw(elltwo);

dot("$F$", F, E);
dot("$O$", O, NE);
dot("$(0,5)$", (0,5), NE);
[/asy]

Without loss of generality, assume that $F=(0,3).$ Then the second ellipse must be tangent to the first ellipse at the point $(0, 5).$ The sum of the distances from $(0,5)$ to the foci of the second ellipse is $2 + 5 = 7,$ so the length of the major axis of the second ellipse is $7.$ Since the distance between the foci of the second ellipse is $3,$ the length of the minor axis of the second ellipse is \[\sqrt{7^2-3^2} = \boxed{2\sqrt{10}}.\]

