Since $P$ lies on the parabola, $PF$ is equal to the distance from $P$ to the directrix, which is $x_1 + a.$  Similarly, $QF$ is equal to the distance from $Q$ to the directrix, which is $x_2 + a.$  Therefore,
\[PQ = x_1 + x_2 + 2a.\]Hence, $c_1 + c_2 + c_3 = 1 + 1 + 2 = \boxed{4}.$

problem:
Let \[f(x) =
\begin{cases}
5x^2+2&\text{if } x\le a, \\
11x &\text{if } x>a.
\end{cases}
\]Find the smallest possible value for $a$ if the graph of $y=f(x)$ is continuous (which means the graph can be drawn without lifting your pencil from the paper).

solution:
Completing the square in $x$ and $y,$ we get
\[\left( x - \frac{1}{2} \right)^2 + \left( y - \frac{1}{2} \right)^2 = \frac{1}{2}.\]This represents the equation of the circle with center $\left( \frac{1}{2}, \frac{1}{2} \right)$ and radius $\frac{1}{\sqrt{2}}.$
[asy]
unitsize(2 cm);

draw(Circle((0,0),1));
draw((0,0)--(1,0));

label("$\frac{1}{\sqrt{2}}$", (1/2,0), S);

dot("$(\frac{1}{2},\frac{1}{2})$", (0,0), N);
dot((1,0));
[/asy]
Hence, the largest possible value of $x$ is $\frac{1}{2} + \frac{1}{\sqrt{2}} = \boxed{\frac{1 + \sqrt{2}}{2}}.$

Notice that the two fractions have the same denominator, so we can add them. Addition is commutative, so we can rearrange the terms to get  \begin{align*}
\frac{k-3}{2} +\frac{3k+1}{2}+3k+1 &=\frac{4k-2}{2}+3k+1 \\
&=2k-1+3k+1 \\
&=\boxed{5k}.\end{align*}

