Because $\triangle ABC$ is an isosceles right triangle, $\angle ABC = 45^\circ$.  Since $\angle ADB = 90^\circ$, we know that $\angle DAB = 45^\circ$, so $\triangle ABD$ is also a 45-45-90 triangle.  Similarly, $\triangle ACD$ is a 45-45-90 triangle.  Therefore, $DB=DC = DA = 4\sqrt{2}$, so $BC = BD+DC = 8\sqrt{2}$, and  \[[ABC] = \frac{(AD)(BC)}{2} = \frac{(4\sqrt{2})(8\sqrt{2})}{2} = \boxed{32}.\]

By Pythagoras, the lengths $x,$ $\sqrt{16 - x^2},$ and 4 are the sides of a right triangle.  Similarly, $y,$ $\sqrt{25 -  y^2},$ and 5 are the sides of a right triangle, and $z,$ $\sqrt{36 - z^2},$ and 6 are the sides of a right triangle.  Stack these right triangles, as shown below.  Then $AE = x + y + z = 9$ and
\[DE = \sqrt{16 - x^2} + \sqrt{25 - y^2} + \sqrt{36 - z^2}.\][asy]
unitsize(0.4 cm);

pair A, B, C, D, E, P, Q, R, trans;

A = (0,0);
B = 4*dir(40);
C = B + 5*dir(60);
D = C + 6*dir(30);
E = (D.x,0);
P = (B.x,0);
Q = (C.x,B.y);
R = (D.x,C.y);
trans = (14,0);

draw(A--B--P--cycle);
draw(B--C--Q--cycle);
draw(C--D--R--cycle);
draw(P--E--R,dashed);

label("$x$", (A + P)/2, S, red);
label("$\sqrt{16 - x^2}$", (B + P)/2, dir(0), red);
label("$4$", (A + B)/2, NW, red);
label("$y$", (B + Q)/2, S, red);
label("$\sqrt{25 - y^2}$", (C + Q)/2, dir(0), red);
label("$5$", (B + C)/2, NW, red);
label("$z$", (C + R)/2, S, red);
label("$\sqrt{36 - z^2}$", (D + R)/2, dir(0), red);
label("$6$", (C + D)/2, NW, red);
label("$A$", A, SW);
label("$B$", B, NW);
label("$C$", C, NW);
label("$D$", D, NE);
label("$E$", E, SE);

draw(shift(trans)*(A--B--C--D--E--cycle));
draw(shift(trans)*(A--D),dashed);

label("$A$", A + trans, SW);
label("$B$", B + trans, SE);
label("$C$", C + trans, NW);
label("$D$", D + trans, NE);
label("$E$", E + trans, SE);
label("$9$", (A + E)/2 + trans, S, red);
label("$\sqrt{16 - x^2} + \sqrt{25 - y^2} + \sqrt{36 - z^2}$", (D + E)/2 + trans, dir(0), red);
[/asy]

By the Triangle Inequality,
\[AD \le AB + BC + CD = 4 + 5 + 6 = 15.\]By Pythagoras on right triangle $ADE,$
\[9^2 + (\sqrt{16 - x^2} + \sqrt{25 - y^2} + \sqrt{36 - z^2})^2 = AD^2 \le 15^2,\]so $(\sqrt{16 - x^2} + \sqrt{25 - y^2} + \sqrt{36 - z^2})^2 \le 15^2 - 9^2 = 144.$  Hence,
\[\sqrt{16 - x^2} + \sqrt{25 - y^2} + \sqrt{36 - z^2} \le 12.\]Equality occurs when $x = \frac{12}{5},$ $y = 3,$ and $z = \frac{18}{5}.$  (Note that this corresponds to the case where $A,$ $B,$ $C,$ and $D$ are collinear.)  Thus, the maximum value we seek is $\boxed{12}.$

[asy]
import three;
triple A = (4,8,0);
triple B= (4,0,0);
triple C = (0,0,0);
triple D = (0,8,0);
triple P = (4,8,6);
draw(B--P--D--A--B);
draw(A--P);
draw(A--C--P, dashed);
draw(B--C--D,dashed);
label("$A$",A,S);
label("$B$",B,W);
label("$C$",C,S);
label("$D$",D,E);
label("$P$",P,N);
[/asy]

Since $\overline{PA}$ is perpendicular to both $\overline{AB}$ and $\overline{AD}$, the segment $\overline{PA}$ is the altitude from the apex to the base of the pyramid.   Applying the Pythagorean Theorem to triangle $ABC$ gives us $AC = \sqrt{13}$.  Applying the Pythagorean Theorem to triangle $PAC$ gives us $PA = \sqrt{PC^2 - AC^2} = \sqrt{12} = 2\sqrt{3}$.

The area of the base of the pyramid is $[ABCD] = (AB)(BC) = 6$, so the volume of the pyramid is $\frac13(6)(2\sqrt{3}) = \boxed{4\sqrt{3}}$ cubic units.

We change the order of summation: \[
\sum_{k=2}^\infty \sum_{j=2}^{2008} \frac{1}{j^k}
= \sum_{j=2}^{2008} \sum_{k=2}^\infty \frac{1}{j^k}
= \sum_{j=2}^{2008} \frac{1}{j^2(1 - \frac{1}{j})}
= \sum_{j=2}^{2008} \frac{1}{j(j-1)}
= \sum_{j=2}^{2008} \displaystyle \left( \frac 1 {j-1} - \frac 1 j \displaystyle \right)
= 1 - \frac 1 {2008}
= \boxed{\frac{2007}{2008}}.
\]

