Because $\triangle ABC$ is an isosceles right triangle, $\angle ABC = 45^\circ$.  Since $\angle ADB = 90^\circ$, we know that $\angle DAB = 45^\circ$, so $\triangle ABD$ is also a 45-45-90 triangle.  Similarly, $\triangle ACD$ is a 45-45-90 triangle.  Therefore, $DA=DB = DC = 5$, so $BC = BD+DC = 10$, and  \[[ABC] = \frac{(AD)(BC)}{2} = \frac{(5)({10})}{2} = \boxed{25}.\]

Writing everything in terms of prime factorizations, the given expression is  \begin{align*}
&\sqrt{3 \cdot 5 \cdot 2^2 \cdot 3 \cdot 2^2 \cdot 7 \cdot 3^2 \cdot x^3} \\
& \qquad = \sqrt{(3^4 \cdot 2^4 \cdot x^2) \cdot (5 \cdot 7 \cdot x)} \\
& \qquad = \boxed{36x \sqrt{35x}}.
\end{align*}

The probability that both $a$ and $b$ are positive is $\left(\frac{1}{4}\right)\left(\frac{2}{3}\right)=\frac{1}{6}$. The probability that $a$ and $b$ are both negative is $\left(\frac{3}{4}\right)\left(\frac{1}{3}\right)=\frac{1}{4}$.  Since $ab$ is positive if and only if one of these two events occur, the probability that $ab$ is positive is $\dfrac{1}{6}+\dfrac{1}{4}=\boxed{\dfrac{5}{12}}$.  Graphically, we can picture the possible outcomes for $(a,b)$ as a rectangle in a Cartesian plane.  The shaded rectangles are the regions in which $ab>0$. [asy]
